function linea(){
  var doc = new jsPDF();
  doc.line(20, 10, 30, 20);
  doc.addPage();
  doc.save('ejemplo.pdf');
}

function imagen(){
  var pdf =  new jsPDF();
  var img = 'data:image/jpeg;base64,';
  pdf.addImage(img, 'JPEG', 15, 40, 180, 160);
  pdf.save('image.pdf');
}

function circulos(){
  var pdf = new jsPDF();
  pdf.ellipse(49,80,15,100);
  pdf.save('circulo.pdf');
}